import React from 'react';
import './cardlist.css';
import './card';
import Card from './card';

const CardList = props => {
    return <div className= 'cardlist'>
                        {props.bbook.map(bbook=>(
            <Card key={bbook.id} monster={book}/>
          ))}
    </div>
};

export default CardList;
